import React, { Component } from "react";

const style = {
  container: {
    width: "70%",
    height: 50,
    backgroundColor: "#F5F5F5",
    borderRadius: 10
  }
};

export const TaskDetailContainer = () => {
  return <div style={style.container} />;
};

export default TaskDetailContainer;
